import { Container, Row, Col } from "react-bootstrap";
import { Link, NavLink } from "react-router-dom";
import Navbar from "../../Navbar/Navbar";

import Box from '@mui/material/Box';
import Item from '@mui/material/Box';


import "./Home.css";

import headerImg from "../../../img/header-img.png";
import headerLogo from "../../../img/header-logo.png";

export default function Home() {
  return (
    <>
      <Navbar />
      <div className="header">
        <div>
          <img src={headerLogo} alt="" className="header-logo"></img>
          <h3 className="header-h3">
            Quickly and Easily Discover Developers Like You, Connect With Your
            Ideal Teammates and Coding Better Together.
          </h3>
          <Link to="/signup">
            <button className="header-btn-1">Sign up</button>
          </Link>
          <button className="header-btn-2">What is Devteams</button>
          <p className="header-p">
            Already a member?
            <Link to="/signin" className="header-link">
              Log in here
            </Link>
          </p>
        </div>

        <div>
          <img src={headerImg} alt="" className="header-img"></img>
        </div>
      </div>

      <Box
        sx={{
          display: "flex",
          justifyContent: "space-evenly",
          p: 1,
          m: 1,
          bgcolor: "background.paper",
        }}
      >
        <Item>Item 1</Item>
        <Item>Item 2</Item>
        <Item>Item 3</Item>
      </Box>
    </>
  );
}
